Zu mir: Hei&szlig;e Corinna, bin 21, letzte Season Platin und wie soll es anders sein Main Support. :D Bin aber bereit andere Lanes zu &uuml;ben, im Jungle spiele ich zB gerne KhaZix oder Evelynn, Adc geht bei mir auch ganz gut, da spiele ich zB Twitch oder Kaisa. Midlane Ahri ganz gerne :D 
W&auml;re toll, wenn sich so eine Community finden w&uuml;rde. :) {{sticker:sg-ahri-2}}
